import React from 'react';
import { fetchSurvey } from '../../actions';
import { connect } from 'react-redux';
import { reduxForm, Field } from 'redux-form';
import { Link } from 'react-router-dom';
import SurveyField from './SurveyField';
import validateEmails from '../../components/utils/validateEmails';
import formFields from './formFields';

class SurveyEdit extends React.Component {
    
    state = { survey: [] };

    componentDidMount() {
        const item = fetchSurvey(this.props.match.params.id);
        const result = item.then(res => this.setState({ survey: res }));
        console.log(this.state.survey);
    }


    render() {
        return(
            <div>
                {console.log(this.props.match.params.id)}
                Survey Edit
                {console.log(this.state.survey[0])}
            </div>
        )
    }
}



export default reduxForm({
    form: 'surveyForm',
    destroyOnUnmount: false
  })(SurveyEdit);
